import React, { useState } from "react"
import { useTranslation, withTranslation } from "react-i18next"
import PropTypes from 'prop-types';
import {
    Row,
    Col,
    Button,
    Label,
    Input,
    Modal,
    Card,
    CardBody,
    CardFooter,
    InputGroup,
    CardHeader,
    Table,
} from "reactstrap"
import Switch from "react-switch";
import { AvForm, AvField, AvGroup } from "availity-reactstrap-validation"
import { BackendServices } from "../../../../services";
import { useLocation } from "react-router-dom";
import { useHistory } from "react-router-dom";
import * as url from "../../../../helpers/url_helper"

const estiloTotales = { backgroundColor: "lightgrey", color: "black" }
const Offsymbol = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                height: "100%",
                fontSize: 12,
                color: "#fff",
                paddingRight: 2,
            }}
        >
            {" "}
            No
        </div>
    );
};
const OnSymbol = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                height: "100%",
                fontSize: 12,
                color: "#fff",
                paddingRight: 2,
            }}
        >
            {" "}
            Si
        </div>
    );
};
const PrevicualizarIGR = (props) => {
    let modelo = {
        datosGenerales: {
            codigoTipoIdentificacion: null,
            numeroCliente: null,
            primerNombre: null,
            segundoNombre: null,
            primerApellido: null,
            segundoApellido: null,
            numeroIdentificacion: null,
            transactId: 0,
            economicGroup: {
                code: "",
                name: ""
            },
            economicActivity: {
                code: "",
                name: ""
            },
            subeconomicActivity: {
                code: "",
                name: ""
            },
            bank: {
                code: "",
                name: ""
            },
        },
        datosEmpresa: {
            transactId: "",
            referencePoint: "",
            residency: "",
            houseNumber: "",
            phoneNumber: "",
            mobileNumber: "",
            workNumber: "",
            email: "",
            exclusion: false,
            sustainable: false,
            apto: "",
            country: {
                code: "",
                name: ""
            },
            province: {
                code: "",
                name: ""
            },
            district: {
                code: "",
                name: ""
            },
            township: {
                code: "",
                name: ""
            },
            city: {
                code: "",
                name: ""
            },
            sector: {
