                        </Col>
                        <Col xl="10">
                            <Label htmlFor="clientNumber">{data.dataRecomendacionesOtros.recommendations == "" || data.dataRecomendacionesOtros.recommendations == null ? t("NoData") : data.dataRecomendacionesOtros.recommendations}</Label>
