                        <Col xl="10">
                            <Label htmlFor="clientNumber">{data.dataRecomendacionesOtros.refinancingLog == "" || data.dataRecomendacionesOtros.refinancingLog == null ? t("NoData") : data.dataRecomendacionesOtros.refinancingLog}</Label>
